    tabs: [
      "Home",
      "About",
      "Free Lessons",
      "Teaching Philosophy",
      "Rates & Policies",
      "Student Testimonials",
      "Contact",
    ],

    content: [
      <Home />,
      <About />,
      <FreeLessons />,
      <Philosophy />,
      <Rates />,
      <Testimonials />,
      <Contact />,
    ],
  };
  return (
    <div id="main-container">
      <img
        src="./newwebhead.jpg"
        alt="The Lord Of The Strings-Guitar and Music Theory Lessons-All Levels & Styles-Acoustic or electric"
        id="image-header"
        // ref={imgRef}
      ></img>
      <Tabs page={page} />
    </div>
    // <>
    //   <BrowserRouter>
